import React from "react";

import cl from "./App.module.scss";

import Header from "../Header/Header";
import Footer from "../Footer/Footer";

const App: React.FC = () => {
  return (
    <div className={cl["app"]}>
      <h1>App Content</h1>
      <Header />
      <Footer />
    </div>
  );
};

export default App;
